import * as React from 'react';
import { useState } from 'react';
import { Header } from '../../components/layout/Header';

export default () => {
  const [menuModal, setMenuModal] = useState(false);

  const switchMenuModal = () => {
    setMenuModal(!menuModal);
  };
  return <></>;
};
